{"source":{"uri":"features\/about_this_site.feature","data":"Feature: As a internet user\n         I want to enter to About the GMO Site\n         so I can see more information about GMO Online Site\n@maximize @HomePage @AboutThisSite\nScenario: Visit GMOPost About This Site Page\n  Given I am on the Google homepage\n  When I visit GMO OnLine\n  And I will click \"About The GMO Site\" button\n  Then I see the About The GMO Site\n  And I see a warning that says \"DO NOT ENTER REAL BILLING OR SHIPPING INFORMATION\"\n  And I see a table with the technologies used by this site\n  \n","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/billing.feature","data":"Feature: Billing Information View\n  As a user\n  I want to fill out the billing information form\n  So that I can place an order\n\n  Background:\n    Given I am on the GMO OnLine Page\n    And I see a button that says \"Enter GMO OnLine\"\n    And I will click \"Enter GMO OnLine\" button\n    Then I am on the online catalog homepage\n    And I see a table with products to buy\n    When I select the item \"Back Country Shorts\" and set the quantity to \"1\"\n    And I click the \"Place An Order\" button\n    And I click the Proceed With Order button\n    Then I should see the billing information page\n    \n  @maximize\n  @Catalog @HomePage  @Confirmation  @Billing\n  Scenario: Billing and shipping information are the same\n  When I fill in the billing form with valid details\n    | Field          | Value               |\n    | Name           | John Doe            |\n    | Address        | 123 Main St         |\n    | City           | Springfield         |\n    | State          | IL                  |\n    | Zip            | 62704               |\n    | Phone          | 555-123-4567        |\n    | E-mail         | john@example.com    |\n    | Card Type      | Visa                |\n    | Card Number    | 4111111111111111    |\n    | Expiration     | 12\/99               |\n  And I check the \"Same as Bill To\" checkbox\n  And I submit the form\n  Then I should see the order confirmation page\n\n  @maximize\n  @Catalog @HomePage  @Confirmation  @Billing\n  Scenario: Billing and shipping information are different\n  When I fill in the billing form with valid details\n    | Field          | Value               |\n    | Name           | John Doe            |\n    | Address        | 123 Main St         |\n    | City           | Springfield         |\n    | State          | IL                  |\n    | Zip            | 62704               |\n    | Phone          | 555-123-4567        |\n    | E-mail         | john@example.com    |\n    | Card Type      | Visa                |\n    | Card Number    | 4111111111111111    |\n    | Expiration     | 12\/97             |\n  And I uncheck the \"Same as Bill To\" checkbox\n  And I fill in the shipping form with valid details\n    | Field          | Value               |\n    | Name           | Jane Smith          |\n    | Address        | 456 Elm St          |\n    | City           | Shelbyville         |\n    | State          | MO                  |\n    | Zip            | 63019               |\n    | Phone          | 555-987-6543        |\n  And I submit the form\n  Then I should see the order confirmation page with different billing and shipping data\n\n  @maximize\n  @Catalog @HomePage @Billing\n  Scenario: Credit card expiration date is invalid\n  When I fill in the billing form with valid details\n    | Field          | Value               |\n    | Name           | John Doe            |\n    | Address        | 123 Main St         |\n    | City           | Springfield         |\n    | State          | IL                  |\n    | Zip            | 62704               |\n    | Phone          | 555-123-4567        |\n    | E-mail         | john@example.com    |\n    | Card Type      | Visa                |\n    | Card Number    | 4111111111111111    |\n    | Expiration     | 12\/00               |\n  And I check the \"Same as Bill To\" checkbox\n  And I submit the form\n  Then I should see an alert with the text \"Please enter a valid date of the form 'MM\/YY' in this field.\"\n\n  @maximize\n  @Catalog @HomePage @Billing\n  Scenario: Billing form has missing required fields\n    When I fill in the billing form with invalid details\n      | Field          | Value               |\n      | Name           |                     |\n      | Address        |                     |\n      | City           |                     |\n      | State          |                     |\n      | Zip            |                     |\n      | Phone          |                     |\n      | E-mail         |                     |\n      | Card Type      | Visa                |\n      | Card Number    | 4111111111111111    |\n      | Expiration     | 12\/97               |\n    And I submit the form\n    Then I should see an alert with the text \"This is a required field.\"\n\n  @maximize\n  @Catalog @HomePage @Billing\n  Scenario: \"Same as Bill To\" checkbox is not checked and shipping form is empty\n    When I fill in the billing form with valid details\n      | Field          | Value               |\n      | Name           | John Doe            |\n      | Address        | 123 Main St         |\n      | City           | Springfield         |\n      | State          | IL                  |\n      | Zip            | 62704               |\n      | Phone          | 555-123-4567        |\n      | E-mail         | john@example.com    |\n      | Card Type      | Visa                |\n      | Card Number    | 4111111111111111    |\n      | Expiration     | 12\/97               |\n    And I uncheck the \"Same as Bill To\" checkbox\n    And I leave the shipping form empty\n    And I submit the form\n    Then I should see an alert with the text \"This is a required field.\"\n\n  @maximize\n  @Catalog @HomePage @Billing\n  Scenario: \"Same as Bill To\" checkbox is not checked and shipping form is empty\n    When I fill in the billing form with valid details\n      | Field          | Value               |\n      | Name           | John Doe            |\n      | Address        | 123 Main St         |\n      | City           | Springfield         |\n      | State          | IL                  |\n      | Zip            | 62704               |\n      | Phone          | 555-123-4567        |\n      | E-mail         | john@example.com    |\n      | Card Type      | Visa                |\n      | Card Number    | 4111111111111111    |\n      | Expiration     | 12\/97               |\n    And I uncheck the \"Same as Bill To\" checkbox\n    And I leave the shipping form empty\n    And I submit the form\n    Then I should see an alert with the text \"This is a required field.\"\n\n  @maximize\n  @Catalog @HomePage @Billing\n  Scenario: Billing form contains invalid email format\n    When I fill in the billing form with invalid details\n      | Field          | Value               |\n      | Name           | John Doe            |\n      | Address        | 123 Main St         |\n      | City           | Springfield         |\n      | State          | IL                  |\n      | Zip            | 62704               |\n      | Phone          | 555-123-4567        |\n      | E-mail         | john@example        |\n      | Card Type      | Visa                |\n      | Card Number    | 4111111111111111    |\n      | Expiration     | 12\/97               |\n    And I check the \"Same as Bill To\" checkbox\n    And I submit the form\n    Then I should see an alert with the text \"Invalid email format. Please enter a valid email.\"\n\n  @maximize\n  @Catalog @HomePage @Billing @Confirmation\n  Scenario: Successful submission with edge-case data\n    When I fill in the billing form with edge-case details\n      | Field          | Value                     |\n      | Name           | Maximilianus-Alexandros   |\n      | Address        | 789 Longname Lane Apt #7  |\n      | City           | New Springfield           |\n      | State          | WY                        |\n      | Zip            | 82001                     |\n      | Phone          | 555-123-4567              |\n      | E-mail         | unique.email@rare.coop    |\n      | Card Type      | Visa                      |\n      | Card Number    | 4111111111111111          |\n      | Expiration     | 01\/28                     |\n    And I check the \"Same as Bill To\" checkbox\n    And I submit the form\n    Then I should see the order confirmation page\n\n  @maximize\n  @Catalog @HomePage @Billing\n  Scenario: Invalid phone number format\n    When I fill in the billing form with invalid phone number\n      | Field          | Value               |\n      | Phone          | 555123             |\n    And I submit the form\n    Then I should see an alert with the text \"This is a required field.\"\n\n  @maximize\n  @Catalog @HomePage @Billing\n  Scenario: Invalid phone number length\n    When I fill in the billing form with invalid phone number\n      | Field          | Value               |\n      | Phone          | 555-123-4567890123 |\n    And I submit the form\n    Then I should see an alert with the text \"This is a required field.\"\n\n  @maximize\n  @Catalog @HomePage @Billing\n  Scenario: Missing mandatory billing details\n    When I fill in the billing form without providing mandatory fields\n      | Field          | Value               |\n      | Name           |                     |\n      | Address        |                     |\n    And I submit the form\n    Then I should see an alert with the text \"This is a required field.\"\n\n  @maximize\n  @Catalog @HomePage @Billing\n  Scenario: Billing form contains an invalid ZIP code\n    When I fill in the billing form with invalid details\n      | Field          | Value               |\n      | Name           | John Doe            |\n      | Address        | 123 Main St         |\n      | City           | Springfield         |\n      | State          | IL                  |\n      | Zip            | 62ABC               |\n      | Phone          | 555-123-4567        |\n      | E-mail         | john@example.com    |\n      | Card Type      | Visa                |\n      | Card Number    | 4111111111111111    |\n      | Expiration     | 12\/97               |\n    And I check the \"Same as Bill To\" checkbox\n    And I submit the form\n    Then I should see an alert with the text \"Please enter a valid zip code in this field.\"","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/browser_test_page.feature","data":"Feature: As a internet user\n         I want to enter to Browser Test Page\n         so I can compare how different browsers render web content\n         \n@maximize @HomePage @BrowserTestPage\nScenario: Visit GMOPost Browser Test Page\n  Given I am on the Google homepage\n  When I visit GMO OnLine\n  And I will click \"Browser Test Page\" button\n  Then I see the Browser Test page\n  And I see a table showing the differences between browsers render\n  And I see an element that moves with the message \"Sometimes Even Left and Right Doesn't Mean Anything\"\n","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/full_flow.feature","data":"Feature: As a internet user\n         I want to enter to GMO OnLine\n         so I can place an order\n\n@maximize @HomePage @Catalog @Billing @Confirmation\nScenario Outline: Place an order\n  Given I am on the Google homepage\n  When I visit GMO OnLine\n  And I will click \"Enter GMO OnLine\" button\n  And I am on the online catalog homepage\n  And I select the item \"<Item>\" and set the quantity to \"<Quantity>\"\n  And I click the \"Place An Order\" button\n  And I should see the item \"<Item>\" with quantity \"<Quantity>\" in the order summary\n  And the total price should be \"<Total_Price>\"\n  And I click the Proceed With Order button\n  Then I should see the billing information page\n  And I fill in the billing form with valid details\n    | Field          | Value               |\n    | Name           | John Doe            |\n    | Address        | 123 Main St         |\n    | City           | Springfield         |\n    | State          | IL                  |\n    | Zip            | 62704               |\n    | Phone          | 555-123-4567        |\n    | E-mail         | john@example.com    |\n    | Card Type      | Visa                |\n    | Card Number    | 4111111111111111    |\n    | Expiration     | 12\/99               |\n  And I check the \"Same as Bill To\" checkbox\n  And I submit the form\n  Then I should see the order confirmation page\n  And I see a button that says \"Return to Home Page\"\n   Examples:\n      | Quantity | Item                    | Total_Price   |\n      | 1        | 3 Person Dome Tent      | 299.99        |\n      | 999      | 3 Person Dome Tent      | 299690.01     |\n      | 1        | Back Country Shorts     | 24.95         |\n      | 999      | Back Country Shorts     | 24925.05      |\n      | 1        | Hiking Boots            | 109.90        |\n      | 999      | Hiking Boots            | 109790.1      |\n      | 1        | Padded Socks            | 19.99         |\n      | 999      | Padded Socks            | 19970.01      |\n      | 1        | Glacier Sun Glasses     | 67.99         |\n      | 999      | Glacier Sun Glasses     | 67922.01      |\n      | 1        | External Frame Backpack | 179.95        |\n      | 999      | External Frame Backpack | 179770.05     | \n    \n\n@maximize @HomePage @Catalog @Billing @Confirmation\nScenario Outline: Place an order and Return to Home Page\n  Given I am on the Google homepage\n  When I visit GMO OnLine\n  And I will click \"Enter GMO OnLine\" button\n  And I am on the online catalog homepage\n  And I select the item \"<Item>\" and set the quantity to \"<Quantity>\"\n  And I click the \"Place An Order\" button\n  And I should see the item \"<Item>\" with quantity \"<Quantity>\" in the order summary\n  And the total price should be \"<Total_Price>\"\n  And I click the Proceed With Order button\n  Then I should see the billing information page\n  And I fill in the billing form with valid details\n    | Field          | Value               |\n    | Name           | John Doe            |\n    | Address        | 123 Main St         |\n    | City           | Springfield         |\n    | State          | IL                  |\n    | Zip            | 62704               |\n    | Phone          | 555-123-4567        |\n    | E-mail         | john@example.com    |\n    | Card Type      | Visa                |\n    | Card Number    | 4111111111111111    |\n    | Expiration     | 12\/99               |\n  And I check the \"Same as Bill To\" checkbox\n  And I submit the form\n  Then I should see the order confirmation page\n  And I click the \"Return to Home Page\" button\n  Then I see a text that says \"Welcome to Green Mountain Outpost's OnLine Catalog!\"\n  And I see a button that says \"Enter GMO OnLine\"\n  And I see a button that says \"About The GMO Site\"\n  And I see a button that says \"Browser Test Page\"\n  Examples:\nExamples:\n      | Quantity | Item                    | Total_Price   |\n      | 1        | 3 Person Dome Tent      | 299.99        |\n      | 999      | 3 Person Dome Tent      | 299690.01     |\n      | 1        | Back Country Shorts     | 24.95         |\n      | 999      | Back Country Shorts     | 24925.05      |\n      | 1        | Hiking Boots            | 109.90        |\n      | 999      | Hiking Boots            | 109790.1      |\n      | 1        | Padded Socks            | 19.99         |\n      | 999      | Padded Socks            | 19970.01      |\n      | 1        | Glacier Sun Glasses     | 67.99         |\n      | 999      | Glacier Sun Glasses     | 67922.01      |\n      | 1        | External Frame Backpack | 179.95        |\n      | 999      | External Frame Backpack | 179770.05     | ","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/gmo_home_page.feature","data":"Feature: As a internet user\n         I want to enter to GMO OnLine\n         so I test that it works correctly\n         \n@maximize\n@HomePage\nScenario: Visit GMOPost and see welcome text\n  Given I am on the Google homepage\n  When I visit GMO OnLine\n  Then I see a text that says \"Welcome to Green Mountain Outpost's OnLine Catalog!\"\n  And I see a button that says \"Enter GMO OnLine\"\n  And I see a button that says \"About The GMO Site\"\n  And I see a button that says \"Browser Test Page\"\n@maximize\n@HomePage @Catalog\nScenario: Visit GMOPost catalog\n  Given I am on the Google homepage\n  When I visit GMO OnLine\n  And I will click \"Enter GMO OnLine\" button\n  Then I am on the online catalog homepage\n  And I see a table with products to buy\n","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/navigate_to_billing.feature","data":"Feature: Navigate to the billing page\n  As a user\n  I want to navigate to the billing information page\n  So that I can place an order\n\n  Background:\n    Given I am on the GMO OnLine Page\n    And I see a button that says \"Enter GMO OnLine\"\n    And I will click \"Enter GMO OnLine\" button\n    Then I am on the online catalog homepage\n    And I see a table with products to buy\n\n  @maximize\n  @Catalog @HomePage @Billing\n  Scenario: Successfully navigate to the billing page\n    When I select the item \"Back Country Shorts\" and set the quantity to \"1\"\n    And I click the \"Place An Order\" button\n    And I click the Proceed With Order button\n    Then I should see the billing information page","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/place_order.feature","data":"Feature: Place an order in the online catalog\n  As a user\n  I want to select items and quantities from the catalog\n  So that I can place an order successfully\n\n  Background:\n    Given I am on the GMO OnLine Page\n    And I see a button that says \"Enter GMO OnLine\"\n    And I will click \"Enter GMO OnLine\" button\n    Then I am on the online catalog homepage\n    And I see a table with products to buy\n\n  @maximize @Catalog @HomePage\n  Scenario Outline: Prevent zero quantities for any catalog item\n    When I select the item \"<Item>\" and set the quantity to \"<Quantity>\"\n    And I click the \"Place An Order\" button\n    Then I should see an alert with the message \"Please Order Something First\"\n\n    Examples:\n      | Quantity | Item                    |\n      | 0        | 3 Person Dome Tent      |\n      | 0        | Back Country Shorts     |\n      | 0        | External Frame Backpack |\n      | 0        | Glacier Sun Glasses     |\n      | 0        | Hiking Boots            |\n      | 0        | Padded Socks            |\n\n  @maximize @Catalog @HomePage\n  Scenario Outline: Prevent invalid quantities for any catalog item\n    When I select the item \"<Item>\" and set the quantity to \"<Quantity>\"\n    And I click the \"Place An Order\" button\n    Then I should see an alert with the message \"Please enter only digits in this field.\"\n\n    Examples:\n      | Quantity | Item                    |\n      | -1       | 3 Person Dome Tent      |\n      | -1       | Back Country Shorts     |\n      | -1       | External Frame Backpack |\n      | -1       | Glacier Sun Glasses     |\n      | -1       | Hiking Boots            |\n      | -1       | Padded Socks            |\n      | -999     | 3 Person Dome Tent      |\n      | -999     | Back Country Shorts     |\n      | -999     | External Frame Backpack |\n      | -999     | Glacier Sun Glasses     |\n      | -999     | Hiking Boots            |\n      | -999     | Padded Socks            |\n      | uno      | 3 Person Dome Tent      |\n      | dos      | Back Country Shorts     |\n      | tres     | External Frame Backpack |\n      | cuatro   | Glacier Sun Glasses     |\n      | cinco    | Hiking Boots            |\n      | seis     | Padded Socks            |\n\n  @maximize @Catalog @HomePage\n  Scenario Outline: Ordering one item with variable quantities\n    When I select the item \"<Item>\" and set the quantity to \"<Quantity>\"\n    And I click the \"Place An Order\" button\n    Then I should see the item \"<Item>\" with quantity \"<Quantity>\" in the order summary\n    And the total price should be \"<Total_Price>\"\n\n    Examples:\n      | Quantity | Item                    | Total_Price   |\n      | 1        | 3 Person Dome Tent      | 299.99        |\n      | 999      | 3 Person Dome Tent      | 299690.01     |\n      | 1        | Back Country Shorts     | 24.95         |\n      | 999      | Back Country Shorts     | 24925.05      |\n      | 1        | Hiking Boots            | 109.90        |\n      | 999      | Hiking Boots            | 109790.1      |\n      | 1        | Padded Socks            | 19.99         |\n      | 999      | Padded Socks            | 19970.01      |\n      | 1        | Glacier Sun Glasses     | 67.99         |\n      | 999      | Glacier Sun Glasses     | 67922.01      |\n      | 1        | External Frame Backpack | 179.95        |\n      | 999      | External Frame Backpack | 179770.05     |            \n\n  @maximize @Catalog @HomePage\n  Scenario: Ordering 2 items in the online catalog\n    When I select the item \"Back Country Shorts\" and set the quantity to \"10\"\n    And I select the item \"Hiking Boots\" and set the quantity to \"5\"\n    And I click the \"Place An Order\" button\n    Then I should see the item \"Back Country Shorts\" with quantity \"10\" in the order summary\n    And I should see the item \"Hiking Boots\" with quantity \"5\" in the order summary\n    And the total price should be \"799\"\n\n  @maximize @Catalog @HomePage\n  Scenario: Ordering 3 items in the online catalog\n    When I select the item \"Back Country Shorts\" and set the quantity to \"2\"\n    And I select the item \"Hiking Boots\" and set the quantity to \"3\"\n    And I select the item \"Padded Socks\" and set the quantity to \"6\"\n    And I click the \"Place An Order\" button\n    Then I should see the item \"Back Country Shorts\" with quantity \"2\" in the order summary\n    And I should see the item \"Hiking Boots\" with quantity \"3\" in the order summary\n    And I should see the item \"Padded Socks\" with quantity \"6\" in the order summary\n    And the total price should be \"499.54\"\n\n  @maximize @Catalog @HomePage\n  Scenario: Ordering 4 items in the online catalog\n    When I select the item \"Back Country Shorts\" and set the quantity to \"1\"\n    And I select the item \"Hiking Boots\" and set the quantity to \"2\"\n    And I select the item \"Padded Socks\" and set the quantity to \"3\"\n    And I select the item \"Glacier Sun Glasses\" and set the quantity to \"1\"\n    And I click the \"Place An Order\" button\n    Then I should see the item \"Back Country Shorts\" with quantity \"1\" in the order summary\n    And I should see the item \"Hiking Boots\" with quantity \"2\" in the order summary\n    And I should see the item \"Padded Socks\" with quantity \"3\" in the order summary\n    And I should see the item \"Glacier Sun Glasses\" with quantity \"1\" in the order summary\n    And the total price should be \"372.71\"\n\n  @maximize @Catalog @HomePage\n  Scenario: Ordering 5 items in the online catalog\n    When I select the item \"Back Country Shorts\" and set the quantity to \"1\"\n    And I select the item \"Hiking Boots\" and set the quantity to \"1\"\n    And I select the item \"Padded Socks\" and set the quantity to \"4\"\n    And I select the item \"Glacier Sun Glasses\" and set the quantity to \"2\"\n    And I select the item \"External Frame Backpack\" and set the quantity to \"1\"\n    And I click the \"Place An Order\" button\n    Then I should see the item \"Back Country Shorts\" with quantity \"1\" in the order summary\n    And I should see the item \"Hiking Boots\" with quantity \"1\" in the order summary\n    And I should see the item \"Padded Socks\" with quantity \"4\" in the order summary\n    And I should see the item \"Glacier Sun Glasses\" with quantity \"2\" in the order summary\n    And I should see the item \"External Frame Backpack\" with quantity \"1\" in the order summary\n    And the total price should be \"530.74\"\n\n  @maximize @Catalog @HomePage\n  Scenario: Ordering all 6 items in the online catalog\n    When I select the item \"3 Person Dome Tent\" and set the quantity to \"1\"\n    And I select the item \"Back Country Shorts\" and set the quantity to \"1\"\n    And I select the item \"Hiking Boots\" and set the quantity to \"1\"\n    And I select the item \"Padded Socks\" and set the quantity to \"2\"\n    And I select the item \"Glacier Sun Glasses\" and set the quantity to \"2\"\n    And I select the item \"External Frame Backpack\" and set the quantity to \"1\"\n    And I click the \"Place An Order\" button\n    Then I should see the item \"3 Person Dome Tent\" with quantity \"1\" in the order summary\n    And I should see the item \"Back Country Shorts\" with quantity \"1\" in the order summary\n    And I should see the item \"Hiking Boots\" with quantity \"1\" in the order summary\n    And I should see the item \"Padded Socks\" with quantity \"2\" in the order summary\n    And I should see the item \"Glacier Sun Glasses\" with quantity \"2\" in the order summary\n    And I should see the item \"External Frame Backpack\" with quantity \"1\" in the order summary\n    And the total price should be \"790.75\"","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/product_detail.feature","data":"Feature: As a internet user\n         I want to enter to an Specific product\n         so I can see more information and details about it  \n@maximize\n@HomePage @Catalog\nScenario Outline: See a product detail\n  Given I am on the GMO OnLine Page\n  And I see a button that says \"Enter GMO OnLine\"\n  And I will click \"Enter GMO OnLine\" button\n  Then I am on the online catalog homepage\n  When I click on \"<productName>\"\n  Then I see the Section \"<sectionName>\"\n  And I see the Unit Price \"<unitPrice>\"\n  And I see the Item Number \"<itemNumber>\"\n\n  Examples:\n    | productName             | sectionName | unitPrice  | itemNumber |\n    | 3 Person Dome Tent      | tents       | $ 299.99   | 1000       |\n    | External Frame Backpack | backpack    | $ 179.95   | 1001       |\n    | Glacier Sun Glasses     | glasses     | $ 67.99    | 1002       |\n    | Padded Socks            | socks       | $ 19.99    | 1003       |\n    | Hiking Boots            | boots       | $ 109.90   | 1004       |\n    | Back Country Shorts     | shorts      | $ 24.95    | 1005       |\n    \n","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/reset_order.feature","data":"Feature: Resetting the form in the online catalog\n  As a user\n  I want to reset all selected quantities in the catalog\n  So that I can clear the form and start a new selection\n\n  Background:\n    Given I am on the GMO OnLine Page\n    And I see a button that says \"Enter GMO OnLine\"\n    And I will click \"Enter GMO OnLine\" button\n    Then I am on the online catalog homepage\n    And I see a table with products to buy\n\n  @maximize @Catalog @HomePage\n  Scenario Outline: Resetting items with specific quantities\n    When I select the item \"<Item>\" and set the quantity to \"<Quantity>\"\n    And I click the \"Reset Form\" button\n    Then all quantities should be reset to \"0\"\n\n    Examples:\n      | Quantity | Item                    |\n      | 1        | 3 Person Dome Tent      |\n      | 999      | 3 Person Dome Tent      |\n      | 1        | Back Country Shorts     |\n      | 999      | Back Country Shorts     |\n      | 1        | Hiking Boots            |\n      | 999      | Hiking Boots            |\n      | 1        | Padded Socks            |\n      | 999      | Padded Socks            |\n      | 1        | Glacier Sun Glasses     |\n      | 999      | Glacier Sun Glasses     |\n      | 1        | External Frame Backpack |\n      | 999      | External Frame Backpack |   \n\n\n  @maximize @Catalog @HomePage\n  Scenario: Resetting quantities after selecting 2 items\n    When I select the item \"Back Country Shorts\" and set the quantity to \"10\"\n    And I select the item \"Hiking Boots\" and set the quantity to \"5\"\n    And I click the \"Reset Form\" button\n    Then all quantities should be reset to \"0\"\n\n  @maximize @Catalog @HomePage\n  Scenario: Resetting quantities after selecting 3 items\n    When I select the item \"Back Country Shorts\" and set the quantity to \"2\"\n    And I select the item \"Hiking Boots\" and set the quantity to \"3\"\n    And I select the item \"Padded Socks\" and set the quantity to \"6\"\n    And I click the \"Reset Form\" button\n    Then all quantities should be reset to \"0\"\n\n  @maximize @Catalog @HomePage\n  Scenario: Resetting quantities after selecting 4 items\n    When I select the item \"Back Country Shorts\" and set the quantity to \"1\"\n    And I select the item \"Hiking Boots\" and set the quantity to \"2\"\n    And I select the item \"Padded Socks\" and set the quantity to \"3\"\n    And I select the item \"Glacier Sun Glasses\" and set the quantity to \"1\"\n    And I click the \"Reset Form\" button\n    Then all quantities should be reset to \"0\"\n\n  @maximize @Catalog @HomePage\n  Scenario: Resetting quantities after selecting 5 items\n    When I select the item \"Back Country Shorts\" and set the quantity to \"1\"\n    And I select the item \"Hiking Boots\" and set the quantity to \"1\"\n    And I select the item \"Padded Socks\" and set the quantity to \"4\"\n    And I select the item \"Glacier Sun Glasses\" and set the quantity to \"2\"\n    And I select the item \"External Frame Backpack\" and set the quantity to \"1\"\n    And I click the \"Reset Form\" button\n    Then all quantities should be reset to \"0\"\n\n  @maximize @Catalog @HomePage\n  Scenario: Ordering all 6 items in the online catalog\n    When I select the item \"3 Person Dome Tent\" and set the quantity to \"1\"\n    And I select the item \"Back Country Shorts\" and set the quantity to \"1\"\n    And I select the item \"Hiking Boots\" and set the quantity to \"1\"\n    And I select the item \"Padded Socks\" and set the quantity to \"2\"\n    And I select the item \"Glacier Sun Glasses\" and set the quantity to \"2\"\n    And I select the item \"External Frame Backpack\" and set the quantity to \"1\"\n    And I click the \"Reset Form\" button\n    Then all quantities should be reset to \"0\"\n","mediaType":"text\/x.cucumber.gherkin+plain"}},
